import React, { useState } from 'react';
import ButtonGroup from "react-bootstrap/ButtonGroup";
import Button from "react-bootstrap/Button";
import Clock from 'react-digital-clock';
import ReactDOM from 'react-dom';                                                   
// import Card from './List';
// import Para from './Para';
// import Apps from './Apps';
// import Cunt from './cunt';
//  import ImgMediaCard from './Card'
import Form from 'react-bootstrap/Form';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
 ReactDOM.render(  <>

 <React.Fragment >
<h1 className='text-capitalize col-10 m-5 text-center text-danger' >welcome to my pC</h1>

<div className='col-sm'><Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="https://picsum.photos/id/237/100/180" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card></div>
<div className='col-sm'><Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="https://picsum.photos/id/237/100/181" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card></div>
<div className='col-sm'><Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src="https://picsum.photos/id/237/100/179.5" />
  <Card.Body>
    <Card.Title>Card Title</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card></div>

 </React.Fragment>

  </>
  , document.getElementById('root')
  );
